import React,  { useState} from 'react';
import axios from "axios";

function WordList() {
    const [arrayWord, addWord] = useState([]);

     async function temp() {
         try {
             let response = await axios.get('https://learn-words-7ba20-default-rtdb.firebaseio.com/word.json');
             Object.keys(response.data).forEach(key => {
                 addWord(prevState => ([...prevState, response.data[key]]))
             });
         }catch (e) {
             console.log(e)
         }
    }
    return (
        <div>
            <button onClick={temp}>x</button>
            {
                <p>{arrayWord[0].word.toString()}</p>
            }
        </div>
    );
}

export default WordList;
